package javaEclips;

public class nexted_loop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i=0;i<3;i++)
		{
			for(int j=0;j<3;j++)
			{
				System.out.println(i+" "+j);
			}
			System.out.print("\n");
		}

	}

}

//ans
/*
0 0
0 1
0 2

1 0
1 1
1 2

2 0
2 1
2 2

*/
